Who are America’s Children?  
 
Data from the US Census Bureau shows us a lot about children and their health in America today. 
 
For example –  
 
🔹There are over 73 million children in the US. This has remained stable over the last few decades. 
 
🔹1 in 4 children was born or has a parent that was born in another country. Without immigration, the number of children in the US would be declining. 
 
🔹Half of US children are a race other than white. 
 
🔹1 in 5 children speak a language other than English at home.  
 
🔹1 in 6 children lives below the federal poverty level (<$25,465 for a family of 4) 
 
Today’s children face unlike any other.  I’m not just addressing Covid-19 as a global health pandemic, but other issues like 
 
▪️Racism 
▪️Health Care Coverage & Access 
▪️Immigrant Child Health 
▪️Climate Change & Clean Air 
▪️Gun Violence 
 
So who are America’s children? 
 
They’re the face of my child. They share they same public health issues your children do. 
  
Everyone deserves the opportunity to live to their full health potential. Voting is one of the main ways we can influence these public policies.  Election day 2020, November 3, is a crucial day for children’s health. Sharing this video (thank you to @alokpatelmd and @teenhealthdoc for this initiative and vision) I made with fellow pediatricians advocating for our kids-Get out there and vote for them in November because their future depends on it! 
 
